import React from 'react';

// components
import MyPostsContainer from '../MyPosts/MyPostsContainer';
import ProfileInfo from '../ProfileInfo/ProfileInfo';

const Profile = ({profile, status}) => {
    return <div>
        <ProfileInfo
            profile={profile}
            status={status} />
        <MyPostsContainer />
    </div>
}

export default Profile;
